        return(
               <div className="container-fluid" id="yt" style={{padding:'10px', paddingTop:'30px'}}>

                   <div className="row">
                        <div className="col-sm-10"><input id="searchbox" placeholder="Search audiobooks" style={{
                            border:'1px solid black',
                            backgroundColor:'black',
                            padding:'5px',
                            width:'100%',
                            borderRadius:'5px',
                            paddingLeft:'10px',
                            color:'white'}}></input>
                        </div>
                   <div className="col-sm-2">
                       <button onClick={()=>{
                           console.log(document.getElementById('searchbox').value);
                        axios.get(`https://www.googleapis.com/youtube/v3/search?part=snippet&key=AIzaSyDbFRSu_mnSfK3sUBm5nBrNx09jdxjyiTo&type=video&q=${document.getElementById('searchbox').value +" audiobook"}`, {}).
                        then((res)=>{
                            console.log(document.getElementById('searchbox').value);
                            console.log(res.data.item);
                        })
                       }}>Search</button>
                   </div>
                   </div>

                   <div className="row">
                        {

                        }
                   </div>
               </div>

        )
    }

}
export default YoutubeAudio;
